import { Helpers, PageMain, SimpleGrid } from "core";
import React, { Component } from "react";
import NotificationSystem from "react-notification-system";
import constants from "../../../utils/constants";
import { IsLegalPersonNationalIdValid, IsRealPersonNationalIdValid } from "../../../utils/nationalIdentification";
import { personNumberTypeOptions } from "../../../utils/selectOptionsUtils";

export default class RequestStrListPage extends Component {
    constructor(props) {
        super(props);

        this.state = {
            isLoading: false,
            filterOptions: [
                { type: 'datepicker', name: 'transactionFromDate', title: 'از تاریخ تراکنش', useEpoch: true, isRequired: true },
                { type: 'datepicker', name: 'transactionToDate', title: 'تا تاریخ تراکنش', useEpoch: true, isRequired: true },
                { type: 'number', name: 'customerNumber', title: 'شماره مشتری', minLength: '1', maxLength: '25', placeholder: ' ' },
                { type: 'number', name: 'accountNumber', title: 'شماره حساب', minLength: '1', maxLength: '25', placeholder: ' ' },
                { type: 'select', name: 'personNumberTypeId', title: 'نوع شخص', selectOptions: personNumberTypeOptions(), isRequired: true },
                { type: 'text', name: 'nationalNumber', title: 'کد ملی/ شناسه ملی/کد فراگیر اتباع', isRequired: true },
            ],
        };

        this.notificationSystem = React.createRef();
        this.onBeforeSubmit = this.onBeforeSubmit.bind(this);
    }

    onBeforeSubmit(e) {
        if (e.filter.personNumberTypeId == constants.PersonNumberType.Real.value && !IsRealPersonNationalIdValid(e.filter.nationalNumber)) {
            Helpers.DisplayErrorMessage(this.notificationSystem, constants.ValidationMessages.RealNationalNumberIsNotValid);
            return false;
        }
        if (e.filter.personNumberTypeId == constants.PersonNumberType.Legal.value && !IsLegalPersonNationalIdValid(e.filter.nationalNumber)) {
            Helpers.DisplayErrorMessage(this.notificationSystem, constants.ValidationMessages.LegalNationalNumberIsNotValid);
            return false;
        }
        return true;
    }

    componentDidMount() {
        document.getElementById('input-filter_nationalNumber').setAttribute('disabled', true);
        this.state.filterOptions.filter(f => f.name == 'personNumberTypeId')[0].onChange = this.onPersonNumberTypeIdChange;
    }

    onPersonNumberTypeIdChange = (e) => {
        let title = 'کد ملی/ شناسه ملی/کد فراگیر اتباع';
        let length = 0;
        if (e.value == constants.PersonNumberType.Real.value) {
            title = 'کد ملی';
            length = 10;
        }
        else if (e.value == constants.PersonNumberType.Legal.value) {
            title = 'شناسه ملی';
            length = 11;
        }
        else if (e.value == constants.PersonNumberType.Foreign.value) {
            title = 'کد فراگیر اتباع';
            length = 12;
        }
        this.state.filterOptions[5] = { type: 'text', name: 'nationalNumber', title: title, minLength: length, maxLength: length, placeholder: ' ' };
        document.getElementById('input-filter_nationalNumber').removeAttribute('disabled');
    };

    render() {
        return (
            <>
                <PageMain context={this} title="گزارش STR" icon="report-search" isLoading={this.state.isLoading}
                    footerLinks={[{ href: "/", text: "صفحه اصلی" }]}>

                    <div className='card'>
                        <div className='card-body'>
                            <SimpleGrid listApiUrl="/api/amls/bi/Receive_STR_/SearchPersonReceive_STR" context={ this } title="گزارش STR" dataKey="id"
                                name="grSrtReport" lgCol={ 12 } mdCol={ 12 } hasSearchBox={ false } notificationSystem={ this.notificationSystem }
                                minHeightTableWrapper={ constants.MinGridHeight } onBeforeSubmit={ this.onBeforeSubmit } filterOptions={ this.state.filterOptions }
                                headers={[
                                    { type: "text", name: "cln01", title: "نام موسسه" },
                                    { type: "text", name: "cln02", title: "کد کاربر" },
                                    { type: "text", name: "cln03", title: "نام شعبه" },
                                    { type: "text", name: "cln04", title: "کد شعبه" },
                                    { type: "text", name: "cln05", title: "استان" },
                                    { type: "text", name: "cln06", title: "شهر" },
                                    { type: "text", name: "cln07", title: "تاریخ گزارش" },
                                    { type: "text", name: "cln08", title: "نام/نام موسسه" },
                                    { type: "text", name: "cln09", title: "نام خانوادگی" },
                                    { type: "text", name: "cln10", title: "شماره ملی / شناسه ملی " },
                                    { type: "text", name: "cln11", title: "شماره شناسنامه / شماره ثبت " },
                                    { type: "text", name: "cln12", title: "نام پدر" },
                                    { type: "text", name: "cln13", title: "نوع عملیات" },
                                    { type: "text", name: "cln14", title: "نوع وجه" },
                                    { type: "text", name: "cln15", title: "نوع حساب" },
                                    { type: "text", name: "cln16", title: "شماره حساب" },
                                    { type: "text", name: "cln17", title: "نام بانک" },
                                    { type: "text", name: "cln18", title: "مبلغ" },
                                    { type: "text", name: "cln19", title: "واحد پول" },
                                    { type: "text", name: "cln20", title: "تاریخ چک" },
                                    { type: "text", name: "cln21", title: "سری" },
                                    { type: "text", name: "cln22", title: "سریال" },
                                    { type: "text", name: "cln23", title: "نوع چک" },
                                    { type: "text", name: "cln24", title: "نام بانک" },
                                    { type: "text", name: "cln25", title: "نام شعبه" },
                                    { type: "text", name: "cln26", title: "کد شعبه" },
                                    { type: "text", name: "cln27", title: "شماره حساب" },
                                    { type: "text", name: "cln28", title: "نام و نام خانوادگی صاحب حساب" },
                                    { type: "text", name: "cln29", title: "مبلغ" },
                                    { type: "text", name: "cln30", title: "واحد پول" },
                                    { type: "text", name: "cln31", title: "در وجه" },
                                    { type: "text", name: "cln32", title: "نام ظهرنویس چک" },
                                    { type: "text", name: "cln33", title: "نام خریدار چک بانکی" },
                                    { type: "text", name: "cln34", title: "نام" },
                                    { type: "text", name: "cln35", title: "نام خانوادگی" },
                                    { type: "text", name: "cln36", title: "نام پدر" },
                                    { type: "text", name: "cln37", title: "شماره ملی" },
                                    { type: "text", name: "cln38", title: "شماره شناسنامه" },
                                    { type: "text", name: "cln39", title: "تاریخ تولد" },
                                    { type: "text", name: "cln40", title: "استان" },
                                    { type: "text", name: "cln41", title: "شهر" },
                                    { type: "text", name: "cln42", title: "نشانی محل سکونت" },
                                    { type: "text", name: "cln43", title: "کد پستی" },
                                    { type: "text", name: "cln44", title: "تلفن منزل" },
                                    { type: "text", name: "cln45", title: "تلفن همراه" },
                                    { type: "text", name: "cln46", title: "شغل" },
                                    { type: "text", name: "cln47", title: "نشانی کار" },
                                    { type: "text", name: "cln48", title: "کدپستی کار" },
                                    { type: "text", name: "cln49", title: "تلفن کار" },
                                    { type: "text", name: "cln50", title: "توضیحات تکمیلی" },
                                    { type: "text", name: "cln51", title: "شماره STR" },
                                ]}
                            />
                        </div>
                        <div className="card-footer">
                            <div className="d-flex">
                                <a className="btn btn-outline-secendery ms-auto" onClick={(e) => this.Backward(e)}
                                    href="/" title="بازگشت به صفحه قبل">بازگشت<i className="ti ti-arrow-left ms-1"></i></a>
                            </div>
                        </div>
                    </div>
                </PageMain>
                <NotificationSystem ref={this.notificationSystem} />
            </>
        );
    }
}
